  return (
    <>
      <Switch data="data">
        <div className="App" id="main">
-          <div className="row">
            <div className="col-md-9 box">
              <div className="inner">
                <Route exact path="/" component={Dashboard} />
              </div>
            </div>
            <div className="col-md-3 box">
              <div className="inner">
                --
              </div>
            </div>
          </div>
        </div>
      </Switch>
    </>
  );
};

export default App;
